import "./footer.css"


function Footer() {
    return (
        <>
            <footer class="footer">

                <div class="footer-content">
                    <div class="footer-text">
                        <p>© 2023 SPACELY Todos los derechos reservados Política de Privacidad y Cookies</p>
                    </div>
                    <div class="footer-images" >
                        <a href="https://github.com/nrg2486/LND"><img  src="https://cdn-icons-png.flaticon.com/512/25/25231.png" alt="Git" /></a>
                        <a href="https://www.instagram.com/"><img src="https://armariosseykemadrid.es/wp-content/uploads/2019/05/instagram-png-instagram-png-logo-1455.png" alt="Instagram" /></a>
                        <a href="https://www.figma.com/file/SKZwHy8DnPJzu03NFBQ4W4/Spacely?node-id=0%3A1&t=6xByHAScFJ5dcarN-1"><img src="https://cdn-icons-png.flaticon.com/512/5968/5968705.png" alt="Figma" /></a>
                    </div>
                </div>
            </footer>

        </>

    );
}

export default Footer;
